        console.log('1111');
        setLiked(true);
        console.log(liked);
    }

    return (

        <Card className="song">
            <li>
            <th>
                <td>title</td>
                <td>artist</td>
                <td>album</td>
                <td>duration</td>
            </th>
            <tr>
            <td className='title'>{props.title}</td>
            <td className="artist">{props.artist}</td>
            <td className="album">{props.album}</td>
